    function resetToDefault() {
        normalLoopAdjust = 0;
        shieldBreakAdjust = 0;
        refreshAdjust = 0;
        flowRefreshAdjust = 0;
        safetyDelayAdjust = 0;
        normalLoopEntryAdjust = 0;
        shieldLoopEntryAdjust = 0;
        
        normalLoopDelay = baseNormalLoopDelay;
        shieldBreakDelay = baseShieldBreakDelay;
        refreshDelay = baseRefreshDelay;
        flowRefreshDelay = baseFlowRefreshDelay;
        safetyDelay = baseSafetyDelay;
        normalLoopEntryDelay = baseNormalLoopEntryDelay;
        shieldLoopEntryDelay = baseShieldLoopEntryDelay;
        
        saveConfig();
    }
    
    function cleanup() {
        isRunning = false;
        
        scriptResources.threads.forEach(function(thread) {
            try {
                thread.interrupt();
            } catch (e) {}
        });
        scriptResources.threads = [];
        
        if (scriptResources.debugWindow) {
            try {
                scriptResources.debugWindow.close();
            } catch (e) {}
            scriptResources.debugWindow = null;
        }
    }
    
    files.ensureDir("/sdcard/脚本/");
    
    
